import React from 'react'
import {Card, Button} from 'react-bootstrap';

export default class DisplayList extends React.Component{
    makeCard(card, index){
        return(
          <Card border="info" className="text-center" style={{ width: '18rem' }}>
            <Card.Img variant="top" src="holder.js/100px180" src={card.image}/>
            <Card.Body>
              <Card.Title>{card.breed}</Card.Title>
              <Card.Text>
                <p>
                  <h5>${card.price}</h5>
                  size: {card.size}
                  <br/>
                  exercise needed: {card.exercise}
                </p>
              </Card.Text>
              <Button variant="info">This is the one!</Button>
            </Card.Body>
          </Card>
        )
      }
    render(){
        return(
            <div>
                <div className="card">{this.props.list.map(makeCard)}</div>
            </div>
        )
    }
}
